import React from "react";
import ReactDOM from "react-dom";

class WhyChooseUs extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="container mt-2 p-5">
        <p className="h1 text-center"> Why choose us ?</p>
      </div>
    );
  }
}
export default WhyChooseUs;
